import React from 'react';
import './App.css';

function App() {
  const [message, setMessage] = React.useState('Hello World');
  React.useEffect(() => {
    setTimeout(() => {
      setMessage('Thank`s World');
    }, 10000);
  });
  return (
    <div className="App">
      <div className="App-header">{message}</div>
    </div>
  );
}

export default App;
